import logo from './Images/Logo.jpg';
import './App.css';
import Nav from './components/Nav';

function App() {
  return (
    <div>
      <div className='text-center'>
        <img src={logo} className='home-logo img-fluid' alt="Responsive image" />
      </div>
      <div>
        <Nav />
      </div>
      <div>
        <h1  className='home-h1'>Stock market analysis for the  serious part-time investor</h1>
      </div>
    </div>
  );
}

export default App;
